              ".taskContainer {\n  background-color: aliceblue;\n  height: 80%;\n  min-width: 500px;\n  max-width: 500px;\n  margin-top: 8%;\n  margin-left: 2.5%;\n  border-radius: 10px;\n  transition: 20ms;\n  display: flex;\n  flex-direction: column;\n  grid-row: 1/-1;\n  grid-column: 1/-1;\n}\n.taskListContainer {\n  flex: 1;\n  display: flex;\n  flex-direction: column;\n  overflow: auto;\n  border: 2px rgb(144, 144, 144) solid;\n  border-radius: 10px;\n}\n.taskListContainer div {\n  display: flex;\n}\n\n.inputContainer {\n  display: flex;\n}\n.inputContainer input {\n  flex: 1;\n}\n\n.incompleteTaskContainer {\n  display: flex;\n  flex-direction: column;\n}\n.completedTaskContainer {\n  background-color: gray;\n  background: linear-gradient(\n    to right,\n    rgba(0, 0, 0, 0.523) 1%,\n    transparent 50%\n  );\n  background-size: 1px 200px; /* Adjust the size of the cross line */\n  background-position: 0 50%;\n}\n.taskListContainer > div {\n  display: flex;\n  flex-direction: column;\n}\n\n.taskDiv {\n  gap: 20px;\n  border: 2px rgb(144, 144, 144) solid;\n  border-radius: 10px;\n}\n.taskDiv > input {\n  width: min-content;\n  height: min-content;\n}\n.taskDiv > p {\n  width: 50%;\n  margin: 0px;\n  height: 30px;\n  display: grid;\n  align-items: center;\n  align-self: center;\n  font-size: 1rem;\n}\n\n.taskContainerHeader {\n  display: flex;\n  margin-top: 1%;\n  margin-left: 2.5%;\n  gap: 50px;\n  background-color: gray;\n  width: fit-content;\n  height: 40px;\n  border-radius: 10px;\n  grid-row: 1/-1;\n  grid-column: 1/-1;\n}\n.taskContainerHeader button {\n  font-size: 1rem;\n  font-weight: 600;\n  height: max-content;\n  align-self: center;\n  margin-right: 20px;\n}\n.taskContainerHeader h2 {\n  margin-left: 20px;\n  align-self: center;\n}\n.taskOtherDetailContainer {\n  /* width: 100%; */\n  display: flex;\n}\n.taskTagContainer {\n  margin-left: auto;\n  margin-right: 1rem;\n}\n.taskTagContainer label {\n  font-size: 15px;\n  display: inline;\n}\n",
